In an exclusive BBC4 session filmed at BBC Television Centre, Paul Weller performs 
numbers from his album 22 Dreams, solo hits including From the Floorboards Up and 
Peacock Suit, and a couple of classics from The Jam's back catalogue.

Weller performs with his regular five-piece band and is joined on some numbers by 
the Wired Strings and a brass section. He also has special guests, including Oasis 
guitarist Gem Archer on Echoes Round the Sun, fiddle player Eliza Carthy on Wild 
Wood and Where'er You Go and Blur guitarist Graham Coxon on Black River.
